import { CREATE_PROJECT } from '../types/projectTypes';

const createNewProject = project => {
    return {
        type: CREATE_PROJECT,
        payload: project
    }
}

export const createProject = () => {
    return (dispatch, getState) => {
        // make async
        dispatch({
        type: CREATE_PROJECT,
        payload: project
    });
    }
}
